public class CRMFixedOper_TicketManager {

   public GetCaseTicketInfos GetCaseTicketInfos(long caseId, long ticketId) {
      var genericBEManager = new Vanrise.GenericData.Business.GenericBusinessEntityManager();

      var filterGroup = new Vanrise.GenericData.Entities.RecordFilterGroup { Filters = new List<Vanrise.GenericData.Entities.RecordFilter>() };
		filterGroup.Filters.Add(new Vanrise.GenericData.Entities.ObjectListRecordFilter 
		{
			FieldName = "CaseId",
			Values = new List<Object> { caseId},
			CompareOperator = Vanrise.GenericData.Entities.ListRecordFilterOperator.In
		});

		var neededColumns = new List<string> {"ID", "TicketType", "Title", "CaseId", "CompletedTime" , "CompletedBy", "CreatedTime", 
                                                                                        "FreeNotes"};

		var ticketEntities = genericBEManager.GetAllGenericBusinessEntities(new Guid("bbfa17ed-b670-475b-9b2c-560ddc808c4d"), 
                                                                                                                                                                            neededColumns, filterGroup);

                 GetCaseTicketInfos ticketInfos = new CRMFixedOper.GetCaseTicketInfos { Tickets = new List<TicketInfo>() };

                  if(ticketEntities != null)
		  {
			foreach(var ticketEntity in ticketEntities )
		       {
                                var id = (long) ticketEntity.FieldValues["ID"];
				if(id == ticketId) 
				   continue;

				var ticketInfo = new TicketInfo();
				 ticketInfo.ID = id;
				 ticketInfo.Title= ticketEntity.FieldValues["Title"].CastWithValidate<string>("Title") ;
				 ticketInfo.TicketType=  (int)  ticketEntity.FieldValues["TicketType"];
				 ticketInfo.CreatedTime =(DateTime) ticketEntity.FieldValues["CreatedTime"];
                                 ticketInfo.CompletedTime= (DateTime) ticketEntity.FieldValues["CompletedTime"];

				 ticketInfo.Notes = ticketEntity.FieldValues["FreeNotes"].CastWithValidate<string>("FreeNotes") ;
				 ticketInfo.CompletedBy = (int) ticketEntity.FieldValues["CompletedBy"];

				 ticketInfos.Tickets.Add(ticketInfo);
                        }
                   }       

                 return ticketInfos.Tickets != null && ticketInfos.Tickets.Count > 0 ? ticketInfos : null;
   }

}

